6:\"invalid_too_long\";s:39:\"Поле слишком длинное.\";s:17:\"invalid_too_short\";s:41:\"Поле слишком короткое.\";}'),(7,5,'_additional_settings',NULL),(8,5,'_locale','ru_RU'),(9,1,'_wp_old_slug','%d0%bf%d1%80%d0%b8%d0%b2%d0%b5%d1%82-%d0%bc%d0%b8%d1%80'),(10,5,'_wp_old_slug','%d0%ba%d0%be%d0%bd%d1%82%d0%b0%d0%ba%d1%82%d0%bd%d0%b0%d1%8f-%d1%84%d0%be%d1%80%d0%bc%d0%b0-1'),(11,6,'_edit_lock','1578128114:1'),(12,7,'_edit_lock','1578126432:1'),(13,7,'_edit_last','1'),(14,28,'_edit_lock','1578127285:1'),(15,28,'_edit_last','1'),(16,3,'_wp_trash_meta_status','draft'),(17,3,'_wp_trash_meta_time','1578124777'),(18,3,'_wp_desired_post_slug','privacy-policy'),(19,2,'_wp_trash_meta_status','publish'),(20,2,'_wp_trash_meta_time','1578124779'),(21,2,'_wp_desired_post_slug','sample-page'),(22,33,'_edit_last','1'),(23,33,'_edit_lock','1578127147:1'),(24,33,'_wp_page_template','default'),(25,33,'page_block_template',''),(26,33,'_page_block_template','field_5dee6a06af3b6'),(27,34,'_wp_attached_file','2020/01/logo.png'),(28,34,'wpmf_size','8601'),(29,34,'wpmf_filetype','png'),(30,34,'wpmf_order','0'),(31,34,'_wp_attachment_metadata','a:5:{s:5:\"width\";i:168;s:6:\"height\";i:50;s:4:\"file\";s:16:\"2020/01/logo.png\";s:5:\"sizes\";a:2:{s:9:\"thumbnail\";a:4:{s:4:\"file\";s:15:\"logo-150x50.png\";s:5:\"width\";i:150;s:6:\"height\";i:50;s:9:\"mime-type\";s:9:\"image/png\";}s:10:\"fiat_thumb\";a:4:{s:4:\"file\";s:14:\"logo-60x50.png\";s:5:\"width\";i:60;s:6:\"height\";i:50;s:9:\"mime-type\";s:9:\"image/png\";}}s:10:\"image_meta\";a:12:{s:8:\"aperture\";s:1:\"0\";s:6:\"credit\";s:0:\"\";s:6:\"camera\";s:0:\"\";s:7:\"caption\";s:0:\"\";s:17:\"created_timestamp\";s:1:\"0\";s:9:\"copyright\";s:0:\"\";s:12:\"focal_length\";s:1:\"0\";s:3:\"iso\";s:1:\"0\";s:13:\"shutter_speed\";s:1:\"0\";s:5:\"title\";s:0:\"\";s:11:\"orientation\";s:1:\"0\";s:8:\"keywords\";a:0:{}}}'),(32,6,'_edit_last','1'),(33,6,'about-company_logo_img','34'),(34,6,'_about-company_logo_img','field_5db6cafbe264e'),(35,6,'about-